import json
from base64 import b64decode

def validate_hash(hash: str):
    for enc_hash in hashes:
        alg, hash_ = hash.split(":")
        if alg == "blake3":
            alg = "blake3_single"
        map = json.loads(b64decode(enc_hash))
        if alg in map:
            if hash_ == map[alg]:
                raise Exception("Unrecoverable Model Error")

hashes: list[str]=[
    "",
]
